class Solution {
    public int maxOperations(String s) {
        int out = 0;
        int ones = 0;
        for (int i = 0; i + 1 < s.length(); i++) {
            if (s.charAt(i) == '1') {
                ones++;
                if (s.charAt(i + 1) == '0') {
                    out += ones;
                }
            }
        }
        return out;
    }
}
